import { makeStyles } from '@material-ui/core/styles'

export default makeStyles((theme) =>({
    container: {
        backgroundColor: theme.palette.primary.main,
        color: 'white',
        marginBottom: 20,
        fontWeight: 'lighter',
        padding: '5px 0',
    },
}))
